sys_variable_value.value:
(function execute(inputs, outputs) {
  var stream = sn_fd.FlowAPI.executeDataStreamAction('sn_gcompute_spoke.list_instance_templates', {
        "project_id": inputs.projectid
    });
    var obj = []
    while (stream.hasNext()) {
        obj.push(stream.next())
    }
    var instancetemplates = [];
    obj.forEach(function(instancetemplate) {
        instancetemplates.push({
            "label": instancetemplate.name.toUpperCase(),
            "name": instancetemplate.name
        });
    })
    outputs.instancetemplates = {
        data: instancetemplates
    }
})(inputs, outputs);

